from bs4 import BeautifulSoupfrom selenium import webdriverfrom selenium.webdriver.chrome.options import Optionsdef get_old_soccer_games():    chrome_options = Options()    chrome_options.add_argument("--headless")  # Buning orqali brauzerni ekranda ko'rsatmasdan ishga tushiramiz    driver = webdriver.Chrome(options=chrome_options)    driver.get('https://www.flashscore.com/football/')    html = driver.page_source    soup = BeautifulSoup(html, 'html.parser')    old_games = []    game_elements = soup.find_all('div', class_='event__match--last')    for game_element in game_elements:        teams_element = game_element.find_all('div', class_='event__participant')        team1 = teams_element[0].text.strip()        team2 = teams_element[1].text.strip()        score_home = game_element.find('div', class_='event__score event__score--home')        score1 = ''        if score_home:            score1 += score_home.text.strip()        else:            pass        score_away = game_element.find('div', class_='event__score event__score--away')        score2 = score_away.text.strip()        date_element = game_element.find('div', class_='event__time')        date = ''        if date_element:            date += date_element.text.strip()        game_info = {            'team1': team1,            'team2': team2,            'score1': score1,            'score2': score2,            'date': date,        }        old_games.append(game_info)    driver.quit()    return old_gamesold_soccer_games = get_old_soccer_games()for game in old_soccer_games:    if game['score1'] != '-':        print(f"{game['team1']} {game['score1']} vs {game['score2']} {game['team2']}")